import React, { useEffect, useState } from 'react';

const Home = () => {

    useEffect(() => {
        getParts()
    }, [])

    const getParts = async () => {
        try {
            const response2 = await fetch('weatherforecast/GetSome');
            const data = await response2.json()
            console.log('data: ', data)
        }
        catch (error) {
            console.error("error ", error)
        }
    }

    return (
        <div>
            <h1>Hello, I am a functional component!</h1>
            <p>This is a simple example of a functional component in React.</p>
        </div>
    );
};

export default Home;
